import React from "react";

const NoteCard = ({ note }) => (
    <div className="card h-100 shadow-sm">
        <div className="card-body">
            <h5 className="card-title">{note.title}</h5>
            <p className="card-text">{note.content}</p>
        </div>
    </div>
);

export default NoteCard;
